siecle MINICON-PRO（シエクル　ミニコンプロ）
<br><br>
発売以来大好評を頂いているカプラーオンのサブコンピュータ「MINICON（ミニコン）」に、プロスペックモデル「MINICON-PRO（ミニコンプロ）」が新登場。<br>
  「２つのボリュームを回す」「３モードの切替スイッチを切り替える」<br>
  これだけの簡単操作で燃調・制御ポイントが自在に操れるカプラーオンの燃調セッティングツールです。 <br>
<br><br>※MINICON-PROは車種別適合があります。<br>
  必ず適合をご確認ください。
<br><br>＜適合表＞<br>
